import React from 'react';
import { menarray, womenarray, childarray } from '../components/arrayofclothes.js';
import { Navbar } from "../components/Navbar";
import { Clothes } from '../components/Clothes.jsx';
import "./Clothespage.css"


const Clothespage=()=>{
    return(
        <>
        <Navbar findnav={ "search Clothes"}/>
        <div className='content-page-clothes'>
            <div className="partie1">
        <Clothes  array={menarray} />
        </div>
        <div className="partie2">
        <Clothes  array={womenarray} />
        </div>
        div
        <Clothes  array={childarray}  />
        </div>
        </>
    )
}
export default Clothespage;
